import React from "react";
import styles from "./Cell.module.css"

function Cell(props){
	const perc = (100-props.size*0.7*2)/props.size;
	cellStyle={width: `${perc}%`,
							height: `${perc}%`,
							}
	return(
		<div className={styles.cell} 
		style={cellStyle}>
		</div>
	)
}


export default Cell;
